DROP TABLE IF EXISTS "Articles";
CREATE TABLE "Articles" ("initial_date" datetime NOT NULL, "url" varchar(255) NOT NULL UNIQUE, "last_check" datetime NOT NULL DEFAULT '1901-01-01 00:00:00', "git_dir" varchar(255) NOT NULL DEFAULT 'old', "last_update" datetime NOT NULL DEFAULT '1901-01-01 00:00:00', "id" integer PRIMARY KEY);
